import{_ as e,c as t,o as s,a}from"./app.e32337bc.js";const m='{"title":"Admin Interface","description":"","frontmatter":{},"headers":[{"level":2,"title":"Schemes","slug":"schemes"},{"level":3,"title":"Custom Recall Questions","slug":"custom-recall-questions"},{"level":2,"title":"Locales","slug":"locales"},{"level":2,"title":"Surveys","slug":"surveys"},{"level":3,"title":"Start and End dates","slug":"start-and-end-dates"},{"level":2,"title":"Generation of Users","slug":"generation-of-users"}],"relativePath":"admin/index.md","lastUpdated":1642417039293}',r={},i=a('<h1 id="admin-interface" tabindex="-1">Admin Interface <a class="header-anchor" href="#admin-interface" aria-hidden="true">#</a></h1><h2 id="schemes" tabindex="-1">Schemes <a class="header-anchor" href="#schemes" aria-hidden="true">#</a></h2><p>A scheme is a specific set of questions and a single version of the food database that is used as the template for a survey.</p><p>Schemes are intended to be configured by admin users. Custom questions can be defined at specific points in the recall flow, see custom recall section below.</p><p>A scheme requires a locale to denote which food list it will use, and the language(s) of the recall.</p><p>There are two types of scheme:</p><ul><li><code>legacy</code> - these are for legacy versions of I24, and it is not used in this version</li><li><code>data-driven</code> - this is the main type for schemes. This will use the custom recall questions.</li></ul><h3 id="custom-recall-questions" tabindex="-1">Custom Recall Questions <a class="header-anchor" href="#custom-recall-questions" aria-hidden="true">#</a></h3><table><thead><tr><th>Name</th><th>Description</th></tr></thead><tbody><tr><td>Pre-meal</td><td></td></tr><tr><td>Post-meal</td><td></td></tr><tr><td>Submission</td><td>before submission</td></tr><tr><td>Pre-foods</td><td></td></tr><tr><td>Foods</td><td>(during food selection)</td></tr><tr><td>Post-foods</td><td></td></tr></tbody></table><h2 id="locales" tabindex="-1">Locales <a class="header-anchor" href="#locales" aria-hidden="true">#</a></h2><p>A locale is a specific language (e.g. English, Arabic), paired to a specific food list.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Missing foods are added to the locale, rather than scheme.</p></div><h2 id="surveys" tabindex="-1">Surveys <a class="header-anchor" href="#surveys" aria-hidden="true">#</a></h2><p>Surveys are an instance of a scheme, with users attached. These users can be participants who will compelete the survey, or they can be an administrators who will work on this survey.</p><h3 id="start-and-end-dates" tabindex="-1">Start and End dates <a class="header-anchor" href="#start-and-end-dates" aria-hidden="true">#</a></h3><p>These control when the recall is accessible (users navigating to the link before or after these dates will see <strong>????</strong>)</p><h2 id="generation-of-users" tabindex="-1">Generation of Users <a class="header-anchor" href="#generation-of-users" aria-hidden="true">#</a></h2><ul><li><code>allow user generation</code> allows users to generate their own username and password. This feature is primarily used for the demo site of Intake24.</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most surveys will not allow user generation</p></div>',19),o=[i];function d(l,n,c,h,u,f){return s(),t("div",null,o)}var b=e(r,[["render",d]]);export{m as __pageData,b as default};
